local n_skins = 38 local texture_list_default = {}
local texture_list_slim = {
    ["n_murder_drones"] = "",
    ["nature_girl_exoticblue"] = "",
    ["pink_uniform_3ce30faa1ac401b2"] = "",
    ["poinsettia_skinmas"] = "",
    ["polar_bear_5b235a5bf9a07429"] = "",
    ["reindeer_girl_6456005"] = "",
    ["robin213"] = "",
    ["robin_cerulean"] = "",
    ["strawberry_kitty_13486c32a706077"] = "",
    ["tnt_lover_18292693"] = "",
}
for i, v in pairs(texture_list_default) do
	mcl_skins.register_simple_skin({
        index = n_skins,
		texture = "blank.png^[png:" .. v,
	})
    n_skins = n_skins + 1
end
for i, v in pairs(texture_list_slim) do
    mcl_skins.register_simple_skin({
        index = n_skins,
        texture = "blank.png^[png:" .. v,
        slim_arms = true
    })
    n_skins = n_skins + 1
end
